import React from 'react'

const NotesListPage = () => {
    let [notes,setNote] = React.useState([])

    useEffect(()=>{
    getNotes()
    },[])

    let getNotes = async()=>{
        let response = await fetch('http://127.0.0.1:8000/api/notes/')
        let data = await response.json()
        console.log('Data',data)
        setNote(data)
    }
    return (
    <div>
        <h1>NotesListPage</h1>
    </div>
    )
}

export default NotesListPage
